    .controls { display: flex; gap: 12px; flex-wrap: wrap; margin: 12px 0 0; }
    .btn { appearance: none; border: none; border-radius: 10px; padding: 10px 16px; font-weight: 600; cursor: pointer; color: #fff; background: var(--brand); box-shadow: 0 2px 6px rgba(0,0,0,0.2); }
    .btn.secondary { background: #374151; }
    .status { margin-top: 8px; font-size: 14px; color: #374151; }
    ul { margin: 8px 0 0; }
    footer { text-align: center; color: #6b7280; padding: 16px; }
  </style>

      <div class="controls">
        <button id="startBtn" class="btn">📡 Démarrer le suivi</button>
        <button id="stopBtn" class="btn secondary">⏹️ Arrêter</button>
        <button id="refreshBtn" class="btn">🔄 Actualiser une fois</button>
      </div>
      <div id="status" class="status">En attente…</div>
    </div>

  <footer>Source carte: © OpenStreetMap contributors, rendu avec Leaflet.</footer>

  <script src="https://unpkg.com/leaflet/dist/leaflet.js"></script>
  <script>
    // === Initialisation de la carte (centre par défaut: Oujda) ===
    const map_bdb6730597835266f38b781ef766530a = L.map('map').setView([34.68, -1.91], 10);
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
      attribution: '&copy; OpenStreetMap contributors'
    }).addTo(map_bdb6730597835266f38b781ef766530a);

    // === Éléments d'UI ===
    const statusEl = document.getElementById('status');
    const startBtn = document.getElementById('startBtn');
    const stopBtn = document.getElementById('stopBtn');
    const refreshBtn = document.getElementById('refreshBtn');

    // === Variables de suivi ===
    let userMarker = null;
    let accuracyCircle = null;
    let watchId = null;

    function setStatus(msg) { statusEl.textContent = msg; }

    function updatePosition(lat, lng, accuracy) {
      // Supprimer anciens éléments
      if (userMarker) map_bdb6730597835266f38b781ef766530a.removeLayer(userMarker);
      if (accuracyCircle) map_bdb6730597835266f38b781ef766530a.removeLayer(accuracyCircle);

      // Marqueur
      userMarker = L.marker([lat, lng]).addTo(map_bdb6730597835266f38b781ef766530a).bindPopup('📍 Vous êtes ici');
      // Cercle de précision
      if (typeof accuracy === 'number' && !Number.isNaN(accuracy)) {
        accuracyCircle = L.circle([lat, lng], { radius: accuracy, color: '#0078FF', fillColor: '#0078FF', fillOpacity: 0.15 }).addTo(map_bdb6730597835266f38b781ef766530a);
      }

      // Centrer
      map_bdb6730597835266f38b781ef766530a.setView([lat, lng], 15);
    }

    function handleError(error) {
      console.error('Geolocation error:', error);
      const msg = {
        1: 'Permission de localisation refusée.',
        2: 'Position indisponible.',
        3: 'Délai dépassé.',
      }[error.code] || ('Erreur de géolocalisation: ' + (error.message || 'inconnue'));
      alert('⚠️ ' + msg);
      setStatus('⚠️ ' + msg);
    }

    // === Localisation ponctuelle ===
    function locateOnce(showMessage = true) {
      if (!('geolocation' in navigator)) {
        alert("⚠️ Le GPS n'est pas supporté par ce navigateur.");
        setStatus("⚠️ Le GPS n'est pas supporté par ce navigateur.");
        return;
      }
      navigator.geolocation.getCurrentPosition(
        pos => {
          const { latitude: lat, longitude: lng, accuracy } = pos.coords;
          updatePosition(lat, lng, accuracy);
          if (showMessage) console.log('✅ Position mise à jour !');
          setStatus('✅ Position mise à jour (' + lat.toFixed(5) + ', ' + lng.toFixed(5) + ')');
        },
        handleError,
        { enableHighAccuracy: true, timeout: 10000 }
      );
    }

    // === Suivi en direct ===
    function startTracking() {
      if (!('geolocation' in navigator)) {
        alert("⚠️ Le GPS n'est pas supporté par ce navigateur.");
        setStatus("⚠️ Le GPS n'est pas supporté par ce navigateur.");
        return;
      }
      if (watchId !== null) return; // déjà en cours
      watchId = navigator.geolocation.watchPosition(
        pos => {
          const { latitude: lat, longitude: lng, accuracy } = pos.coords;
          updatePosition(lat, lng, accuracy);
          setStatus('📡 Suivi… (' + lat.toFixed(5) + ', ' + lng.toFixed(5) + ')');
        },
        handleError,
        { enableHighAccuracy: true, maximumAge: 0 }
      );
    }

    function stopTracking() {
      if (watchId !== null) {
        navigator.geolocation.clearWatch(watchId);
        watchId = null;
        setStatus('⏹️ Suivi arrêté.');
      }
    }

    // === Boutons ===
    startBtn.addEventListener('click', startTracking);
    stopBtn.addEventListener('click', stopTracking);
    refreshBtn.addEventListener('click', () => locateOnce(true));

    // Démarrage automatique: une localisation ponctuelle au chargement
    locateOnce(false);
  </script>
